  const [isLoggedIn, setIsLoggedIn] = useState(false);
  return isLoggedIn ? (
    <Link to="/channel">
      <UserBlock />
    </Link>
  ) : (
    <Link to="/signin">
      <div>guest</div>
    </Link>
  );
};

export default Login;
